import{_ as e,o as t,c as n,O as i}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 59.1-293.10 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-293.10.md","filePath":"vacode/59.1-293.10.md"}'),a={name:"vacode/59.1-293.10.md"},o=i('<h1 id="§-59-1-293-10-definitions" tabindex="-1">§ 59.1-293.10 Definitions. <a class="header-anchor" href="#§-59-1-293-10-definitions" aria-label="Permalink to &quot;§ 59.1-293.10 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires another meaning:</p><p>&quot;Child-resistant packaging&quot; means packaging that is designed or constructed to meet the child-resistant effectiveness standards set forth in 16 C.F.R. § 1700.15(b)(1) when tested in accordance with the protocols described in 16 C.F.R. § 1700.20 as in effect on July 1, 2015.</p><p>&quot;Liquid nicotine&quot; means a liquid or other substance containing nicotine in any concentration that is sold, marketed, or intended for use in a nicotine vapor product.</p><p>&quot;Liquid nicotine container&quot; means a bottle or other container holding liquid nicotine in any concentration but does not include a cartridge containing liquid nicotine if such cartridge is prefilled and sealed by the manufacturer of such cartridge and is not intended to be opened by the consumer.</p><p>&quot;Nicotine vapor product&quot; has the same meaning as in § <a href="http://law.lis.virginia.gov/vacode/18.2-371.2/" target="_blank" rel="noreferrer">18.2-371.2</a>.</p><p>2015, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0739" target="_blank" rel="noreferrer">739</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0756" target="_blank" rel="noreferrer">756</a>.</p>',7),r=[o];function s(c,d,l,h,p,u){return t(),n("div",null,r)}const g=e(a,[["render",s]]);export{f as __pageData,g as default};
